// TreatmentButtonsList.js

import React from 'react';

const TreatmentButtonsList = props => {

  // Create the treatment-button list items
  const treatmentButtonsListItems = props.labels.map( (currentLabel, i) => {
    return (
      // the key is needed when creating lists in react-land
      <li key={currentLabel + i}>
        <button 
          className="treatment-btn">
          <img 
            className="treatment-btn-icon"
            src={props.icons[i]} 
            alt={"Icon For " + currentLabel} />
          <span className="treatment-btn-label">
            {currentLabel}
          </span>
        </button>  

      </li>
    );
  });

  return(
    <ul className="TreatmentButtonsList-wrapper">
      {treatmentButtonsListItems}
    </ul>
  );

};

export default TreatmentButtonsList;
